Отчетный период:
0 – год;
1 – 4 – кварталы;
5 – прогноз платы за год

Допустимое увеличение содержания взвешенных веществ для водного объекта:
0,25 мг/дм3 для водных объектов, имеющих рыбохозяйственное значение первой категории, а также для водных объектов, использующихся для питьевого и хозяйственно-бытового водоснабжения;
0,75 мг/дм3 для водного объекта, имеющего рыбохозяйственное значение второй категории, а также для объектов, использующихся в черте населенных мест (за исключением использования для питьевого и хозяйственно-бытового водоснабжения)
